buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>127 spotkanie WJUG</h4>\n            <h2>Flashtalks: SmartParam, jFairy, Spring Boot</h2>\n            <h3>Adam Dubiel, Jakub Kubryński, Dariusz Kaczyński</h3>\n            <p>Termin: 17.12.2013 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 3180</p>\n            <h3>SmartParam</h3>\n            <h4>Opis:</h4>\n            <p>SmartParam to wolna biblioteka rozwiązująca problem powtarzający się w wielu systemach enterprise - jak efektywnie i łatwo parametryzować. Z punktu widzenia biznesu parametry to jeden z krytycznych punktów systemu, w teorii powinny pozwalać na szybkie dostosowywanie się do zmian na rynku i nowych celów biznesowych. W praktyce często sprowadza się je do kilku czy kilkunastu tabel w bazie danych, których poprawne oprogramowanie jest żmudne, a każda zmiana kłopotliwa. Tymczasem parametry w swojej naturze są szybkozmienne i wymagają dużej elastyczności.</p>\n            <p>Jak w taki razie nie zakopać się w morzu if-ów z których powoli wyłania się niezarządzalna Big Ball of Mud?</p>\n            <p>Jak pozbyć się bólu głowy związanego z rozszerzaniem tabel parametrycznych o kolejne wymiary?</p>\n            <p>Jak uszczęśliwić biznes zmieniając formułkę "nie da się" na "ok, 1 story point"?</p>\n            <p>SmartParam chce być remedium. Wiemy że to realne, bo protoplasta SmartParama na co dzień sprawdza się w boju w systemach informatycznych jednej z dużych firm ubezpieczeniowych. Jeśli czytając powyższe wprowadzenie kiwałaś ze zrozumieniem głową, przyjdź na naszą prezentację i dowiedz się więcej.</p>\n            <h4>Prelegent: Adam Dubiel</h4>\n            <p>Programowaniem pasjonuje się od dekady, od kilku lat jego dzień dzieli się na programowanie w pracy i programowanie po pracy. Często uważa, że "to da się zrobić lepiej" i na swoje nieszczęście nie ustaje w poszukiwaniach tego "lepiej". Perfekcjonista, od książek czysto technicznych woli czytać te o podejściu do programowania, metodologiach i patternach. Gdyby mógł, co pół roku refactorowałby swój stary kod.</p>\n            <p>Obecnie programista w Allegro, na co dzień programuje w Java i JavaScript (który mimo wszystko uwielbia). Cały wolny czas pożera mu utrzymanie i rozwój własnych projektów OpenSource.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/kbV4-cguETw" frameborder="0" allowfullscreen></iframe></p>\n            <h3>jFairy</h3>\n            <h4>Opis:</h4>\n            <p>Często w projektach pojawia się potrzeba wytworzenia przykładowych danych na potrzeby testów, demonstracji działania systemu, etc W takich przypadkach z reguły uruchamiamy nasze IDE i piszemy klasę PeselGenerator. Można jednak rozwiązać to zagadnienie stosując się do metodologii DRY i wykorzystać gotowy komponent - taki jak jFairy. Z pudełka tworzy on takie rzeczy jak osoby, firmy, emaile, domeny itp. Dodatkowo dostarcza też mechanizmy umożliwiające łatwe rozszerzanie biblioteki o własne generatory danych</p>\n            <h4>Prelegent: Kuba Kubryński</h4>\n            <p>Zawodowo związany z PayU z ramienia którego buduje ogniwo rozwojowe w Warszawie (trzecia głowa smoka). Prywatnie czuje się mocno przywiązany do pakietu java.util.concurrent i klasy sun.misc.Unsafe. Poza tym pasjonują go lekkie aplikacje, w których stosunek kodu do dostarczanej funkcjonalności jest jak najmniejszy.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/kmyrbIuuM9I" frameborder="0" allowfullscreen></iframe></p>\n            <h3>Spring Rebooted</h3>\n            <h4>Opis:</h4>\n            <p>Opis: Spring Framework powstał dekadę temu jako znacznie prostsza, pragmatyczna alternatywa dla nieco przekombinowanej swymi czasy JEE. I choć pozostał wierny idei prostoty, konwencji ponad konfigurację i promowaniu dobrych praktyk, to z biegiem czasu mocno się rozrósł i zyskał niezliczoną ilość nowych możliwości. Dziś rodzina projektów Spring to tysiące stron świetnej dokumentacji, setki tysięcy linii kodu, miliony używających je developerów i setki milionów użytkowników na całym świecie obsługiwanych przez aplikacje na nich oparte. Wraz z najnowszą wersją 4.0 Spring wraca do korzeni i przypomina wszystkim dlaczego powstał - aby upraszczać życie developerom! Zapraszam zatem na krótki pokaz ogromnych możliwości w połączeniu z maksymalną prostotą tworzenia aplikacji przy pomocy Spring Framework. Pokażę jak w ultra efektywny sposób budować funkcjonalności na JVM, nie koniecznie przy użyciu języka Java. Prepare to be amazed ;)</p>\n            <h4>Prelegent: Dariusz Kaczyński</h4>\n            <p>Zawodowo jestem developerem Java od 8 lat i Springa używam od początku swojej kariery. Jest to framework, który jak żaden inny, nigdy mnie nie zawiódł i zawsze potrafiłem przy jego pomocy osiągnąć zamierzony cel. Jako "JVM Developer wannabe" interesuję się również językiem Scala oraz w mniejszym stopniu Groovym. Wierzę również w ciągłą zmienność wszechrzeczy, w tym również, a może przede wszystkim, kodu, więc refactoring to mój najlepszy przyjaciel :)</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/_owQoQomX-Q" frameborder="0" allowfullscreen></iframe></p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
