buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>128 spotkanie WJUG</h4>\n            <h2>Humanoidalny robot NAO (feat.<a href="http://www.humantechart.pl/" target="_blank"> Human Tech Art</a>)</h2>\n            <h3><a href="http://www.aldebaran-robotics.com/en/" target="_blank">Aldebaran Robotics</a></h3>\n            <p>Termin: 09.01.2014 godz. 18:30</p>\n            <p>Lokalizacja: GammaFactory, ul. Hoża 51</p>\n            <p>Sponsor:<a href="http://touk.pl" target="_blank"> <img src="img/sponsors/touk_small.png"/></a></p>\n            <p>Zapisy: <a href="http://www.meetup.com/Warszawa-Java-User-Group-Warszawa-JUG/events/158438982/" target="_blank">meetup</a></p>\n            <h3>O prezentacji:</h3>\n            <p>W czwartek 9 stycznia będziemy gościć<a href="http://www.aldebaran-robotics.com/en/" target="_blank"> Aldebaran Robotics</a> z robotami NAO z Francji!</p>\n            <p>NAO to robot humanoidalny, którego konstrukcja – kamery, głośniki, mikrofony i czujniki – pozwala na interakcję z otoczeniem, komputerem i człowiekiem oraz łączenie się z siecią przez wifi. Wykrywa i rozpoznaje twarz swojego właściciela, robi i wysyła zdjęcia lub wideo. NAO ma też możliwość wykonywania szerokiego zakresu ruchów, pozwalających na chodzenie, wstawanie, kopanie, taniec i siadanie, a dodatkowo porusza się po pomieszczeniu unikając przeszkód. Potrafi również sam wrócić do stacji dokującej, gdy jego bateria jest bliska rozładowaniu. Zaprojektowany do celów badawczych i naukowych, jest w pełni programowalny i dzięki temu skutecznie wykorzystywany w nauczaniu programowania, robotyki oraz zagadnień z zakresu sztucznej inteligencji. </p>\n            <p>Ponieważ łączymy siły z grupą<a href="http://www.humantechart.pl/" target="_blank"> Human Tech Art</a>, agenda jest tak podzielona, abyśmy posłuchali więcej o kodowaniu, a dla osób mniej zainteresowanych technicznymi aspektami przeznaczony był ogólniejszy wykład.</p>\n            <p>W programie spotkania jak zwykle prezentacja prelegentów, po której będzie czas na dyskusję oraz testowanie projektu. </p>\n            <p>Uwaga! Z racji pochodzenia naszych prelegentów (Francja) obie prezentacje odbędą się w języku angielskim.</p>\n            <h3>Agenda:</h3>\n            <p>18:30 Programming NAO Robots - Laurent Lec (Software Architect w<a href="http://www.aldebaran-robotics.com/en/" target="_blank"> Aldebaran Robotics</a>)</p>\n            <p>19:05 NAO Humanoid Robots - Céline Boudier (Manager of NAOLabs Studio Team w<a href="http://www.aldebaran-robotics.com/en/" target="_blank"> Aldebaran Robotics</a>)</p>\n            <p>19:35 Prezentacja robotów i testowanie</p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
