buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>13 spotkanie WJUG</h4>\n            <h2>Java Persistence 1.0 (JPA) i środowisko do praktycznego poznawania specyfikacji</h2>\n            <h3> <a href="http://www.jaceklaskowski.pl/" target="_blank">Jacek Laskowski</a></h3>\n            <p>Termin: 17.07.2007 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 4420</p><strong>Materiały </strong>\n            <ul>\n              <li><a href="https://groups.google.com/forum/#!topic/warszawa-jug/WrE6ZqgP3vY/" target="_blank">zapowiedź</a></li>\n            </ul>\n            <h3>O prezentacji:</h3>\n            <p>Tematem prezentacji będzie wprowadzenie do specyfikacji Java Persistence API (JPA) i przedstawienie środowiska do jej praktycznego poznawania opartego o Apache Maven 2.</p>\n            <p>JPA jest częścią specyfikacji Enterprise JavaBeans 3.0, która z kolei stanowi część specyfikacji Java Enterprise Edition 5 (Java EE 5). W języku Java świat przedstawiany jest w postaci obiektów podczas, gdy w świecie baz danych relacyjnych w postaci krotek. Specyfikacja JDBC wraz z językiem SQL pozwala na pobranie danych z bazy i jej obsługę, jednakże nakłada na programistę obowiązek zasilania danymi relacyjnymi obiektowego modelu danych. Za pomocą rozwiązań mapujących dane relacyjne na typy obiektowe i na odwrót (zwanych rozwiązaniami ORM) mamy możliwość pracy z danymi relacyjnymi obiektowo. W ten sposób możemy znacząco skrócić czas tworzenia aplikacji. Rolą JPA jest ujednolicenie możliwości Hibernate, TopLink oraz JDO i udostępnienie ustandaryzowanego interfejsu dostępu do relacyjnych danych. Podstawową zaletą JPA jest możliwość uruchomienia dostawcy JPA w ramach serwera aplikacyjnego, ale również w trybie poza kontenerem oraz wykorzystanie podejścia programistycznego opartego o POJO. Wiele z funkcjonalności do tej pory znanych z Hibernate jest dostępna w JPA za pomocą darmowych dostawców JPA, którymi są Apache OpenJPA, TopLink Essentials oraz Hibernate EntityManager.</p>\n            <h3>O prelegencie:</h3>\n            <p><a href="http://www.jaceklaskowski.pl/" target="_blank">Jacek Laskowski </a>zajmuje się Korporacyjną Javą od pierwszego dnia jej opublikowania. Jest członkiem zespołów rozwojowych <a href="http://geronimo.apache.org" target="_blank">Apache Geronimo</a>, <a href="http://openejb.apache.org" target="_blank">Apache OpenEJB</a>, <a href="http://incubator.apache.org/servicemix" target="_blank">Apache ServiceMix</a>, <a href="http://geronimo.apache.org/xbean" target="_blank">Apache XBean </a>oraz <a href="http://activemq.apache.org" target="_blank">Apache ActiveMQ</a>. Zajmuje się rozpoznawaniem technologii upraszczających tworzenie aplikacji korporacyjnych z Java EE 5, a swoje spostrzeżenia publikuje w \n              <Notatniku>Projektanta Java EE </Notatniku>oraz na swoim <a href="http://www.jaceklaskowski.pl/wiki/" target="_blank">Notatniku-Wiki</a>. Jest założycielem i liderem Warszawskiej Grupy Użytkowników Javy (Warszawa JUG). Jacek jest członkiem zespołu <a href="http://qa.netbeans.org/processes/cat/60/index.html" target="_blank">NetBeans 6.0 Community Acceptance Test </a>(poprzednio w NetCAT 5.0 oraz 5.5). Ideę dzielenia się wiedzą wprowadza w życie poprzez wystąpienia na konferencjach krajowych i zagranicznych. Służbowo związany z firmą IBM jako konsultant oprogramowania.\n            </p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
