buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>131 spotkanie WJUG</h4>\n            <h2>Adopt OpenJDK -<a href="http://michalwarecki.blogspot.com/" target="_blank"> Michał Warecki</a></h2>\n            <h2>Specification by Example -<a href="http://agile.waw.pl/" target="_blank"> Krzysztof Jelski</a></h2>\n            <p>Termin: 11.02.2014 godz. 18:15</p>\n            <p>Lokalizacja: MIMUW, sala 3180</p>\n            <p>Sponsor:<a href="http://www.decerto.pl/" target="_blank"><img src="img/sponsors/decerto.png"/></a></p><strong>Materiały:</strong>\n            <ul>\n              <li>Adopt OpenJDK:<a href="https://drive.google.com/file/d/0BythMR2PslQJZmZheEpBeHNkd0k/edit?usp=sharing" target="_blank"> slajdy</a></li>\n              <li>Specification by Example:<a href="http://www.slideshare.net/KrzysztofJelski/specification-by-example-at-warsaw-jug" target="_blank"> slajdy</a> |<a href="https://github.com/krzysztof-jelski/atm-example" target="_blank"> kod</a> |<a href="https://relishapp.com/pragmatists/atm/docs/atm" target="_blank"> relish</a></li>\n            </ul>\n            <h1>Adopt OpenJDK</h1>\n            <h3>O prezentacji:</h3>\n            <p>OpenJDK jako referencyjna implementacja JLS i JVM staje się najczęściej używanym oprogramowaniem na świecie. Czy marzyłeś kiedyś o tym, aby "tworzyć lub rozszerzać Javę"? Jeśli chcesz nauczyć się budować, modyfikować i testować OpenJDK, serdecznie zapraszam na krótkiego flash-talka, na którym wprowadzę Ciebie w świat jednego z ciekawszych systemów.</p>\n            <h3>O prelegencie:</h3>\n            <p>Michał jest programistą skupiającym się na technologiach opartych o JVM. Jego głównymi obszarami zainteresowań są: algorytmy GC, współbieżność, algorytmy wolne od blokad oraz kompilatory typu JIT. Tworząc oprogramowanie pamięta jak zbudowane są współczesne procesory, pamięci fizyczne oraz system operacyjny. Nie ogranicza się tylko do poziomu bytecode\'u lecz obserwuje także wewnętrzne komponenty OpenJDK oraz kod maszynowy przez nie generowany.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/gIe8UKA0Urc" frameborder="0" allowfullscreen></iframe></p>\n            <h1>Specification by Example</h1>\n            <h3>O prezentacji:</h3>\n            <p>Czy byłeś kiedykolwiek sfrustrowany tworzeniem funkcjonalności, o której wiedziałeś, że będzie niepotrzebna? Czy zdarzyło ci się spędzać długie godziny na przerabianiu dotychczasowej pracy z powodu niedogadania wymagań między biznesem a deweloperami? Czy zdarzyło ci się zidentyfikować super-istotny przypadek brzegowy już po wdrożeniu na produkcję?</p>\n            <p><a href="http://specificationbyexample.com/key_ideas.html" target="_blank">Specification by Example</a> to podejście, które zmniejsza ryzyko wystąpienia powyższych frustracji w procesie wytwarzania oprogramowania. Schodząc do poziomu szczegółowych przykładów działania funkcjonalności, szybko identyfikujemy przypadki brzegowe i eliminujemy niepotrzebny zakres. Angażując cały zespół, ukierunkowujemy wszystkich na dostarczenie oprogramowania pomagającego realizować cele biznesowe. Automatyzując przykłady, unikamy błędów regresji i dostajemy zawsze aktualną dokumentację.</p>\n            <p>Opowiem o elementach Specification by Example i o tym, jak się ma do BDD. Pokażę też w jaki sposób można automatyzować scenariusze w Javie.</p>\n            <h3>O prelegencie:</h3>\n            <p>Doświadczony deweloper Javy i C#, praktykujący Test-Driven Development. Pracuje na sposób Agile’owy i przez szkolenia i coaching uczy innych tworzenia oprogramowania w ten sposób. Chce, aby software efektywnie pomagał innym w życiu i pracy, dlatego kładzie duży nacisk na komunikację i inne ludzkie aspekty pracy zespołów. Na co dzień w Pragmatists. Właściciel<a href="http://agile-elearning.pl/" target="_blank"> agile-elearning.pl</a>, sprzedaje online’owe szkolenia z Agile’owych praktyk inżynierskich.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/3Sbf8C4nL9E" frameborder="0" allowfullscreen></iframe></p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
