buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h4>96 spotkanie WJUG</h4>\n            <h2>Implementacja architektury usługowej - od specifikacji do kodu </h2>\n            <h3>Paweł Cesar Sanjuan Szklarz</h3>\n            <p>Termin: 05.06.2012 godz. 18:00</p>\n            <p>Lokalizacja: MIMUW, sala 2180 </p>\n            <p> </p><span>Sponsor: </span><a href="http://outbox.pl/" target="_blank">Outbox</a>\n            <p></p><strong>Slajdy</strong>\n            <ul>\n              <li> <a href="https://github.com/paweld2/Service-Architecture-Model/blob/master/documentation/pdf/wjug-05062012.pdf" target="_blank">slajdy</a></li>\n            </ul><strong>Dyskusja:</strong>\n            <ul>\n              <li> <a href="https://groups.google.com/forum/#!topic/warszawa-jug/bJqgNK9m4Zg" target="_blank">dyskusja</a></li>\n            </ul>\n            <h3>O wykładzie:</h3>\n            <p>Prelegent przedstawi sposób zdefiniowania architektury usługowej oparty o injektowanie zależności. Moc tej propozycji to injektowanie zależności "zdalnie", implementacja modułów mogą być rozproszone na wielu komputerach. Na spotkaniu będzie wszystko omawiał po kolei, ale wcześniejsze przejrzenie poniższych postów pomoże zorientować się o czym będzie mowa. </p>\n            <p>--- O nowym podejściu do integracji - Protokół kanoniczny: </p>\n            <p> <a href="http://softwaremathmodel.blogspot.com/2012/05/canonical-protocol.html" target="_blank">http://softwaremathmodel.blogspot.com/2012/05/canonical-protocol.html</a></p>\n            <p>--- O konstrukcji "controlled scope" w Guice:</p>\n            <p> <a href="http://softwaremathmodel.blogspot.com/2012/05/controlled-scope.html" target="_blank">http://softwaremathmodel.blogspot.com/2012/05/controlled-scope.html </a></p>\n            <h3>O prelegencie:</h3>\n            <p>Urodziłem się w Warszawie i jako małe dziecko (5 lat) wyjechałem do Meksyku z rodziną. Matka Polka, Ojciec Meksykanin. Wróciłem do Polski na studia i na razie zostałem na dobre.</p>\n            <p>Uczestniczyłem na Olimpiadzie Międzynarodowej z Matematyki w reprezentacji Meksyku w 1998. Studiowałem na MIMUW, Matematyka Stosowana - Metody Numeryczne, częściowo też Mechanika Teoretyczna na MEiL PW. Aktualnie kończę doktorat na MEiL PW o sterowaniu robotów.</p>\n            <p> Od 7 lat pracuję przy tworzeniu aplikacji webowych w javie. Pasjonuje mnie porządek i zrozumienie  jak i dlaczego to wszystko działa (albo i nie!). W pewnym sensie specjalizuję się w GWT oraz injektowanie zależności w Guice.</p>\n            <p><iframe width="853" height="480" src="http://www.youtube.com/embed/ZR9eyRkX6II" frameborder="0" allowfullscreen></iframe></p>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
