buf.push('\n<div>\n  <div page="1" class="section">\n    <div class="centered">\n      <div class="container">\n        <div class="row">\n          <div class="span12">\n            <h2>Newsletter warszawskiego JUG #1</h2>\n            <p><a href="https://groups.google.com/d/msg/warszawa-jug/-Xw-ZyvbnEA/RvxvW5LILtsJ" target="_blank">27.12.2013</a></p>\n            <p>Miesiąc temu spotkaliśmy się aby podsumować kolejne pół roku życia grupy, a także zaplanować kolejne miesiące.</p>\n            <p>\n              Podzieliliśmy się mocno rolami, żeby efektywniej pracować i tak Wojtkowi Erbetowskiemu i Kubie Nabrdalikowi przypadło\n              m.in. upilnowanie, aby działania liderów były dobrze widoczne dla wszystkich. Stąd właśnie ten email.\n            </p>\n            <p>A co się zmieniło przez te 30 dni? Przede wszystkim zmodularyzowaliśmy się :-)<br/>Ważne, abyście wiedzieli kto czym się zajmuje i do kogo w jakiej sprawie uderzyć, a więc oto skład grup liderskich:</p>\n            <h4>Regularne spotkania Warszawa JUG</h4>\n            <p>\n              <ul>\n                <li>Jakub Nabrdalik</li>\n                <li>Michał Lewandowski</li>\n                <li>Kamil Szymański</li>\n                <li>Krzysiek Siejkowski</li>\n              </ul>\n            </p>\n            <h4>Jinkubator</h4>\n            <p>\n              <ul>\n                <li>Justyna Sadło</li>\n                <li>Adam Pierzchała</li>\n                <li>Krzysiek Siejkowski</li>\n                <li>Adam Chudzik</li>\n              </ul>\n            </p>\n            <h4>Scalania</h4>\n            <p>Prowadzi Jacek Laskowski z Grześkiem Kubiakiem.</p>\n            <h4>SpringLabs</h4>\n            <p>Od tego sezonu pomagać mają Darkowi Kaczyńskiemu:\n              <ul>\n                <li>Michał Niczyporuk</li>\n                <li>Adam Chudzik</li>\n              </ul>\n            </p>\n            <h4>Devoxx4Kids</h4>\n            <p>Devoxx4Kids wystartowało mając za kierowców:\n              <ul>\n                <li>Michał Lewandowski</li>\n                <li>Tomek Kucharski</li>\n                <li>Darek Kaczyński</li>\n              </ul>\n            </p>\n            <h4>WJUG-JCP</h4>\n            <p>A za inicjatywę JCP/Adopt OpenJDK/Adopt a JSR/ ... odpowiadają:\n              <ul>\n                <li>Kamil Szymański</li>\n                <li>Michał Warecki</li>\n                <li>Michał Niczyporuk</li>\n              </ul>\n            </p><br/>\n            <p>\n              Do tego są sprawy, które dotyczą niemal wszystkich grup, jak utrzymywanie kanałów społecznościowych (co ogarnia\n              Agnieszka Skiba), organizować sale na MIMUW (Krzysiek Siejkowski), szykować plakaty (Michał Lewandowski), licencje,\n              finanse, nagrywanie i obróbkę wideo i kilka innych.\n            </p>\n            <p>\n              Jak widzicie jest co robić :-) Jeśli podoba Wam się jak działa WJUG (albo chcecie to zmienić) polecam wkręcić się na\n              dwa sposoby:\n              <ul>\n                <li>jako prelegent, zgłaszając temat&nbsp<a href="https://docs.google.com/forms/d/1yF3SxIu0FVsYFufO1odo2eZLZpaWftWG5P2jcCX9PYI/viewform?edit_requested=true" target="_blank">przez formularz</a>, a krótką notkę do przeczytania macie&nbsp<a href="#/by-you" target="_blank">na stronie</a></li>\n                <li>\n                  jako wolontariusz/organizator - wybierz, w której inicjatywie chciałbyś(chciałabyś) wziąć udział i napisz do\n                  prowadzących, lub na grupie (wyraź chęć). Jeśli nie wiesz co mogłoby Ciebie zainteresować, napisz na grupę (lub\n                  indywidualnie do kogoś z liderów) aby podpowiedzieli.\n                </li>\n              </ul>\n            </p>\n            <p>\n              Każda z grup jest otwarta (a ponieważ Jacek Laskowski niedawno zarzucał, że jesteśmy zamknięci na osoby z zewnątrz i\n              nikt nie może się dostać) to znaczy, że nie jest to dostatecznie jasne i napiszę to jasno :-) potrzeba nam pomocy i\n              pozytywnej energii, byle się dowiedzieć, że masz chęć się rozwijać i pracować w teamie organizatorów! Zapraszam :-)\n            </p>\n            <div class="row">\n              <div class="span12">\n                <div class="pull-left"><a href="#/newsletter/2">Następny</a></div>\n              </div>\n            </div>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>');
