buf.push('\n            </p>\n            <p>Witaj szkoło! Oh wait... Hello WJUG!</p>\n            <p>Po wakacjach rozpoczynamy nowy sezon spotkań&nbsp<strong>Warszawskiego JUG</strong>. Mamy garść informacji od inicjatyw, które wspólnie organizujemy.</p>\n            <h4>Walne zgromadzenie</h4>\n            <p>\n              Poprzedni sezon zakończyło walne spotkanie, na którym zrobiliśmy podsumowanie minionego półrocza działalności inicjatyw zrzeszonych pod szyldem\n              Warszawa Java User Group. Rozmawialiśmy o innowacjach które można wprowadzić we WJUG oraz o problemach jakie wystąpiły. Każdy\n              zainteresowany mógł przyłączyć się do wybranej inicjatywy.<br/><strong>Oczywiście drzwi są zawsze otwarte dla chętnych. Serdecznie zapraszamy, nie trzeba czekać ze zgłoszeniem do kolejnego walnego spotkania :-)</strong>\n            </p>\n            <p>Z najważniejszych zmian i nowości:\n              <blockquote class="noborder">\n                <h5>Networking</h5>Pospotkaniowe piwo cieszy się coraz większą popularnością. Chcemy i czynimy wysiłki aby trend się utrzymywał, zapraszając Was po\n                każdym spotkaniu na wspólne piwo. Szukamy też miejsca, gdzie moglibyśmy networking zaczynać przed wykładem, tak jak ma to miejsce\n                na spotkaniach WGUG.\n                <h5>Polecamy Warsaw IO</h5>Na spotkaniach promujemy stronę&nbsp');
