buf.push('.\n                <h5>Sponsorzy spotkań</h5>Już niebawem na stronie pojawi się lista zaprzyjaźnionych firm, które wspierają działalność WJUGa\n                <h5>"Cross-cutting concerns"</h5>W ramach grupy wydzieliliśmy nowe role:\n                <ul>\n                  <li><strong>mentoring</strong>&nbsp- Andrzej Goławski i Matt Harasymczuk wyszukują, zachęcają i służą pomocą dla nowych prelegentów,</li>\n                  <li><strong>sponsorzy</strong>&nbsp- Piotr Turski będzie osobą odpowiadającą za kontakt z firmami które są zainteresowane współpracą z WJUGiem, a także\n                    przekazywaniem kontaktów do poszczególnych inicjatyw. Krzysiek Siejkowski będzie mu pomagał,\n                  </li>\n                  <li><strong>transparencja</strong>&nbsp- Marcin Jasion komunikuje się z poszczególnymi inicjatywami WJUGa aby przekazać Wam informacje o działaniach grupy -\n                    tych obecnych i przyszłych\n                  </li>\n                </ul>\n              </blockquote>\n            </p>\n            <h4>Spotkania cykliczne</h4>\n            <p>\n              W trakcie przerwy wakacyjnej zespół spotkań regularnych odpoczywał i regenerował siły po minionym intensywnym roku. Teraz pełni energii\n              i w odświeżonym składzie wkraczamy w nowy sezon, by proponować Wam jeszcze fajniejsze i ciekawsze spotkania Warszawa Java User Group.\n              Cały czas czekamy na Wasze&nbsp');
